    true,nt"url": null,nt"notes": "This database reproduces a subset of the
    tables and reference functions of NIST Monograph 175, 'Temperature Electromotive
    Force Reference Functions and Tables for the Letter-Designated Thermocouple Types
    Based on the ITS-90'. All temperatures used by this database are given on the International
    Temperature Scale of 1990 (ITS-90), and all emf values are given in units of the
    1990 SI volt. Reference functions and tables are given for the eight letter-designated
    thermocouple types: noble-metal types B, R, and S; and base-metal types E, J, K,
    N, and T. The letter designations used in this database follow the recommendations
    of the Instrumentation, Systems, and Automation Society (ISA) and the American Society
    for Testing and Materials (ASTM).  Version 2.0.",nt"license_title": "Other
